// DashboardPage.js
import React from 'react';
import { useAuth } from './AuthContext';

const DashboardPage = () => {
  const { user } = useAuth();

  return (
    <div>
      <h2>Dashboard Page for logged in user</h2>
      {user && (
        <div>
          <p>Username: {user.username}</p>
          {/* Display other user details as needed */}
        </div>
      )}
    </div>
  );
};

export default DashboardPage;
